import React from 'react';
import { Route, Routes } from 'react-router-dom';
import './App.css';

import HomePage from './pages/homepage/homepage.component';

const HatsPage = () =>{
   return <div>
      <h1>HATS</h1>
   </div>
}



function App() {
  return (
     <Routes>
        <Route exact path={"/"} component={HomePage}/>
      <Route  path={"/hats"} component={HatsPage}/>

        {/* <HomePage/> */}
     </Routes>
  );
}

export default App;
